import React from "react";
import "./style.css"

const Footer = () => {
    return (
        <div className="footer-container">
            <a target='blank' href='https://www.linkedin.com/in/sofia-ferrer-038575187/' style={{ color: 'white' }}>FERRER Sofia</a>
        </div>
    );
}

export { Footer };
